def watering_garden(n, k, a):
    buckets = []
    for i in range(n):
        buckets.append(Bucket(a[i]))

    for i in range(n):
        for j in range(i + 1, n):
            if buckets[i] < buckets[j]:
                buckets[i], buckets[j] = buckets[j], buckets[i]

    buckets = sorted(buckets, key=lambda bucket: bucket.length, reverse=True)

    time = 0
    while k > 0:
        for bucket in buckets:
            if bucket.length <= k:
                k -= bucket.length
                time += bucket.length
                break
            else:
                time += k
                k = 0
                break

    return time


class Bucket:
    def __init__(self, length):
        self.length = length


if __name__ == "__main__":
    n, k = map(int, input().split())
    a = list(map(int, input().split()))
    print(watering_garden(n, k, a))

